import React from 'react';

import './card.styles.css';

export const Card = props => (
  <div className='card-container'>
    <img
      alt='monster'
      src={`${props.item.img}`}
    />
    <h2> {props.item.name} </h2>
    <p> {props.item.description} </p>
  </div>
);
